import React from "react";
import {
  Box,
  Typography,
  Card,
  CardContent,
  CardHeader,
  CardMedia,
  Grid,
  CardActions,
} from "@mui/material";

export default function TourContent({ id, image, info, name, price }) {
  return (
    <Card sx={{borderRadius: "10", boxShadow: "5px 5px 5px 5px #888888", }}>
      <CardMedia component="img" height="194" image={image} />
      <CardContent>
        <Grid container spacing={2}>
          <Grid item xs={8}>
            <Typography variant="body2" color="text.secondary">
              {name}
            </Typography>
          </Grid>
          <Grid item xs={4}>
            <Typography variant="body2" color="text.primary">
              {price}
            </Typography>
          </Grid>
        </Grid>
      </CardContent>
    </Card>
  );
}
